description:
Eddie Murphy ar kungen av komedi. Och i Coming To America, ar han ocksa prins av
komedi - en mycket valbargad afikansk prins som kommer till Amerika for att finna
en fru. Tillsammans med sin baste van (Arsenio Hall) hittar han snabbt ett jobb, nya vanner, nya fiender - och en massa problem...

